frames.customCss:
body {
  font-family: Roboto;
}

body,div,span,table,td,th,header,.icon-edits,.mw-header {
  font-family: Roboto;
  background: #232323 !important;
  color: #ccc !important;
}

a {
  color: #cdcd42 !important;
  border-bottom: 1px solid #dada13 !important;
}

img, video {
  filter: invert(1);
}

svg, [class*="icon"], [class*="Icon"], [class*="btn"], [class*="button"] {
  filter: invert(1);
}

*::-webkit-scrollbar {
  width: 13px;
}

*::-webkit-scrollbar:horizontal {
  height: 8px;
}

*::-webkit-scrollbar-track {
  display: none;
}

*::-webkit-scrollbar-corner {
  display: none;
}

*::-webkit-scrollbar-thumb {
  background: #555;
  opacity: 0.8;
  background-clip: content-box;
  border-left: 2px solid transparent;
}
*::-webkit-scrollbar-thumb:hover, *:hover::-webkit-scrollbar-thumb {
  background-color: #999;
  background-clip: content-box;
  border-left: 2px solid transparent;
}

